import React, { Component } from 'react';
import "material-components-web/dist/material-components-web.min.css";
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import API from '../service/pastlaunches.service';
import Paper from '@material-ui/core/Paper';
import './alllaunches.css';


const classes = theme =>
    ({
        root: {
            width: '100%',
            marginTop: theme.spacing(3),
            overflowX: 'auto',
        },
        table: {
            minWidth: 650,
        },
    });

class AllLaunches extends Component {

    constructor(props) {
        super(props);
        this.state = {
            PastLaunches: []
        }

    }

    componentDidMount() {
        API.getPastLaunches()
            .then((findresponse) => {
                try {
                    this.setState({
                        PastLaunches: findresponse
                    })
                } catch (err) {
                    console.log(err);
                }
                console.log("past launches=======", this.state.PastLaunches);
            })
            .catch((err) => {
                console.log({ status: 500, message: 'Internal Server Error', err });
            })

    }

    /** Render-app */
    render() {
        const { classes } = this.props;
        return (
            <div>
                <Paper className={classes.root}>
                    <Table className={classes.table}>
                        <TableHead>
                            <h2>Past Launches</h2>
                            <TableRow>
                                <TableCell align="left">Payload</TableCell>
                                <TableCell align="left">Rocket</TableCell>
                                <TableCell align="left">Date</TableCell>
                                <TableCell align="left">Success</TableCell>
                            </TableRow>
                        </TableHead>
                        <TableBody>
                            {
                                this.state.PastLaunches.map(pastlaunches =>
                                    <TableRow>
                                        <TableCell align="center">{pastlaunches.mission_name}</TableCell>
                                        <TableCell align="center">{pastlaunches.rocket.rocket_name}</TableCell>
                                        <TableCell align="center">Fat&nbsp;(g)</TableCell>
                                        <TableCell align="center">Carbs&nbsp;(g)</TableCell>
                                    </TableRow>
                                )}
                        </TableBody>
                    </Table>
                </Paper>
            </div>
        )
    }
}
AllLaunches.propTypes = {
    container: PropTypes.object,
};

export default withStyles(classes)(AllLaunches);
